import React from 'react'; 
import{Container,Row,Col} from "reactstrap"


const Footer = () => {
  return (
    <footer className='footer'>
      <Row>
        <Col lg="3" md="4" sm="6">
          <div className='logo'>
            <img src="" alt="" />

          </div>
        </Col>
      </Row>

    </footer>
    
  )
}

export default Footer
